INSERT INTO `dm_report` VALUES (9,'2013-06-08 18:33:57',NULL,NULL,3,'2013-12-01 10:52:53',NULL,NULL,'0000500001',0,0,2,'业务报表',NULL,190,'\n业务报表',NULL,1,0,NULL),(10,'2013-06-08 00:00:00',NULL,NULL,14,'2013-12-01 10:52:41',NULL,NULL,'0000500004',0,0,2,'临时报表',NULL,190,'\n临时报表\n222222',NULL,4,0,NULL),(11,'2013-06-08 00:00:00',NULL,NULL,5,'2013-12-01 10:52:25',NULL,NULL,'0000500003',0,0,2,'定期导出报表',NULL,190,'\n测试分组1',NULL,3,0,'connectionpool-1'),(12,'2013-06-08 00:00:00',NULL,NULL,18,'2013-12-01 10:52:14',NULL,NULL,'0000500002',0,0,2,'效率统计',NULL,190,'\n',NULL,2,0,'connectionpool-1'),(13,'2013-06-08 18:38:31',NULL,NULL,23,'2013-12-01 10:52:14',NULL,NULL,'000050000200001',1,0,3,'测试报表1','\n',12,'测试报表1\n','select id, whCode 仓库Code, w.descr 仓库 from gv_bas_warehouse w where w.id >= ?',1,1,NULL),(14,'2013-06-09 00:00:00',NULL,NULL,10,'2013-12-01 10:52:14',NULL,NULL,'000050000200002',0,0,3,'近一月电商仓发货时效','\n',12,'\ntest','select t.仓库, t.下单到发货间隔小时, t.总发运订单数 \nfrom (\nselect w.descr 仓库,\n       round(sum(to_number((\n                    to_date(to_char(so.lastshipmenttime, \'yyyymmdd hh24:mi:ss\'), \'yyyymmdd hh24:mi:ss\') -\n                    to_date(to_char(so.createdtime, \'yyyymmdd hh24:mi:ss\'), \'yyyymmdd hh24:mi:ss\') \n                    ) * 24)) / count(so.id))  as 下单到发货间隔小时, count(so.id) 总发运订单数\nfrom gv_sales_order_header so, gv_bas_warehouse w, gv_bas_customer c\nwhere so.wh_id = w.id and so.customer_id = c.id\n      and so.status_id = 250\n      and so.createdtime >= trunc(sysdate) - 30\n      and so.createdtime < trunc(sysdate)\n      and w.whclass_id = 109104\ngroup by w.descr) t\norder by t.下单到发货间隔小时\n',2,1,'connectionpool-1'),(15,'2013-06-09 00:00:00',NULL,NULL,4,'2013-12-01 10:52:25',NULL,NULL,'000050000300001',0,0,3,'B2B仓库订单状态统计（考核用）',NULL,11,'\n',NULL,1,0,'connectionpool-1'),(16,'2013-06-09 00:00:00',NULL,NULL,12,'2013-12-01 10:52:14',NULL,NULL,'000050000200003',0,0,3,'订单平均品项及数量',NULL,12,'\ntest','select 仓库, 客户, 订单数, 下单数量, 品项, round(品项/订单数) 品项每单, round(下单数量/订单数) 数量每单 \nfrom (\nselect c.descrcn 客户, w.descr 仓库, count(*) 订单数, sum(soh.skuitem) 品项, sum(soh.totalamount) 下单数量	\nfrom gv_sales_order_header soh, gv_bas_customer c, gv_bas_warehouse w	\n  where soh.customer_id = c.id and soh.wh_id = w.id	\n       and w.whclass_id = 109104\n       and soh.createdtime >= trunc(sysdate) - 30\n       and soh.createdtime < trunc(sysdate)\n  group by c.descrcn, w.descr)\norder by 仓库, 客户',3,1,'connectionpool-1'),(17,'2013-06-09 00:00:00',NULL,NULL,12,'2013-12-11 14:52:34',NULL,NULL,'000050000100001',0,0,3,'库存余量','仓库:Number,货主:String:false,货物:String,库位:String  \n\n\n\n\n',9,NULL,'select sku.skucode SKU, sku.descrcn 产品名称, sku.skueancode EAN, l.locationcode as 库位, \n  t.qtyuom as 库存数量, t.qtyuseuom as 可用数量, t.qtyallocateduom as 分配量 \nfrom gv_inv_lotlocationuom t, gv_bas_sku sku, gv_bas_location l, gv_bas_customer c \nwhere t.qtyuom > 200 and t.sku_id = sku.id and l.id = t.location_id \n   and t.warehouse_id = ? and t.customer_id = c.id and c.customercode = ?\n   <#if param3??> and sku.skuCode in (?) </#if>\n   <#if param4??> and l.locationCode in (?) </#if>',1,1,'connectionpool-1'),(127,'2013-06-13 00:00:00',NULL,NULL,6,'2013-12-01 10:52:41',NULL,NULL,'000050000400001',0,0,3,'仓库列表',NULL,10,'\n','select w.id 仓库ID, w.whcode 仓库Code, w.descr 仓库名称, c.cncodename 仓库类型, o.orgname 组织 \nfrom gv_bas_warehouse w, gv_sys_codeinfo c, gv_bas_orginfo o\nwhere w.whclass_id = c.id and w.org_id = o.id\norder by w.createdtime desc',1,1,'connectionpool-1'),(148,'2013-07-18 00:00:00',NULL,NULL,28,'2013-12-01 10:52:14',NULL,NULL,'000050000200005',0,0,3,'进出存监控',NULL,12,'查看进出存日结信息是否生成，及仓库的作业量\n','select x.idate 日期, \n       x.EC_IN 电商入库量, x.EC_OUT 电商出库量, x.EC_SKU_NUM EC变动SKU数,\n       y.KA_IN KA入库量, y.KA_OUT KA出库量, y.KA_SKU_NUM KA变动SKU数\n from \n  (select t.idate, count(*) EC_SKU_NUM, sum(t.inqty) EC_IN, sum(t.outqty) EC_OUT\n        from rp_daily_ios t, gv_bas_warehouse w \n        where t.warehouse_id = w.id and t.idate >= sysdate - 31  and w.whclass_id = 109104\n        group by t.idate order by t.idate desc) x,\n  (select t.idate, count(*) KA_SKU_NUM, sum(t.inqty) KA_IN, sum(t.outqty) KA_OUT\n        from rp_daily_ios t, gv_bas_warehouse w \n        where t.warehouse_id = w.id and t.idate >= sysdate - 31  and w.whclass_id = 108904\n        group by t.idate order by t.idate desc) y\n where x.idate = y.idate \n order by 日期 desc',5,1,'connectionpool-1'),(177,'2013-07-19 00:00:00',NULL,NULL,6,'2013-12-01 10:52:14',NULL,NULL,'000050000200004',0,0,3,'日单量统计',NULL,12,NULL,'select x.日期, 电商下单量, 电商出库单数, 电商出库量, KA下单量, KA出库单数, KA出库量 \nfrom \n(\nselect trunc(t.createdtime) 日期, \n       count(distinct case when w.whclass_id = 109104 then t.salesorderheader_id end) 电商出库单数,\n       count(distinct case when w.whclass_id = 108904 then t.salesorderheader_id end) KA出库单数,\n       sum(case when w.whclass_id = 109104 then t.sentqtyuom end) 电商出库量,\n       sum(case when w.whclass_id = 108904 then t.sentqtyuom end) KA出库量\n from gv_sales_order_trace t, gv_bas_warehouse w, gv_sys_codeinfo c\n where t.wh_id = w.id and w.whclass_id = c.id and t.createdtime > trunc(sysdate) - 31\n group by trunc(t.createdtime)\n) x,\n(\nselect trunc(t.createdtime) 日期, \n       sum(case when w.whclass_id = 109104 then 1 else 0 end) 电商下单量,\n       sum(case when w.whclass_id = 108904 then 1 else 0 end) KA下单量\n from gv_sales_order_header t, gv_bas_warehouse w, gv_sys_codeinfo c\n where t.wh_id = w.id and w.whclass_id = c.id and t.createdtime > trunc(sysdate) - 31\n group by trunc(t.createdtime) \n ) y\n where x.日期 = y.日期\n order by x.日期 desc',4,1,'connectionpool-1'),(178,'2013-07-19 00:00:00',NULL,NULL,6,'2013-12-01 10:52:25',NULL,NULL,'00005000030000100001',0,0,4,'发运数量',NULL,15,NULL,'select o.orgname 组织, w.descr 仓库, soh.salesorderno 订单, soh.totalamount 订单总数, sum(sod.qtyshippeduom) 发运量,\n       trunc(min(sod.createdtime)) 订单创建时间 \n from  gv_sales_order_details sod, gv_sales_order_header soh, gv_bas_orginfo o, gv_bas_warehouse w \n where sod.salesorderheader_id = soh.id and soh.org_id = o.id and soh.wh_id = w.id             \n      and soh.status_id=967    \n      and soh.wh_id in ( select t.id from gv_bas_warehouse t where t.whclass_id=108904 )     \n      and soh.createdtime >= to_date(\'2013-06-01\', \'yyyy-mm-dd\') \n      and soh.createdtime < to_date(\'2013-07-01\', \'yyyy-mm-dd\') \n group by o.orgname, w.descr, soh.salesorderno, soh.totalamount\n\n\n',1,1,'connectionpool-1'),(179,'2013-07-19 00:00:00',NULL,NULL,5,'2013-12-01 10:52:25',NULL,NULL,'00005000030000100002',0,0,4,'SO订单状态',NULL,15,NULL,'select o.orgname 组织, w.descr 仓库, soh.salesorderno 单号,\n       trunc(soh.createdtime) 订单创建时间, trunc(soh.updatedtime) 订单最后更新时间, \n       c.cncodename 订单状态, soh.remark 备注说明, cr.cncodename 关闭原因, u.username 创建人\nfrom  gv_sales_order_header soh, gv_bas_orginfo o, gv_bas_warehouse w, gv_sys_codeinfo c, gv_sys_codeinfo cr, gv_sys_account u\nwhere soh.org_id = o.id and soh.wh_id = w.id and soh.status_id = c.id \n      and soh.closereason_id = cr.id(+) and soh.creator_id=u.id\n      and w.id in ( select t.id from gv_bas_warehouse t where t.whclass_id=108904 )\n      and c.id <> 250 and c.id <> 2533\n      and soh.createdtime >= to_date(\'2013-06-01\', \'yyyy-mm-dd\') \n      and soh.createdtime < to_date(\'2013-07-01\', \'yyyy-mm-dd\')\norder by w.id, soh.createdtime\n\n',2,1,'connectionpool-1'),(180,'2013-07-19 00:00:00',NULL,NULL,5,'2013-12-01 10:52:25',NULL,NULL,'00005000030000100003',0,0,4,'ASN订单状态',NULL,15,NULL,'select o.orgname 组织, w.descr 仓库, soh.asnno 单号,\n       trunc(soh.createdtime) 订单创建时间, trunc(soh.updatedtime) 订单最后更新时间, \n       c.cncodename 订单状态, c2.cncodename 上架状态, soh.remark 备注说明, cr.cncodename 关闭原因, u.username 创建人 \nfrom  gv_asn_header soh, gv_bas_orginfo o, gv_bas_warehouse w, gv_sys_codeinfo c, gv_sys_codeinfo c2, gv_sys_codeinfo cr, gv_sys_account u\nwhere soh.org_id = o.id and soh.wh_id = w.id and soh.status_id = c.id and soh.statusputaway_id = c2.id(+)\n      and soh.closereason_id = cr.id(+) and soh.creator_id=u.id\n      and w.id in ( select t.id  from gv_bas_warehouse t where t.whclass_id=108904 )\n      and (c.id <> 229 or c2.id <> 1908)\n      and soh.createdtime >= to_date(\'2013-06-01\', \'yyyy-mm-dd\') \n      and soh.createdtime < to_date(\'2013-07-01\', \'yyyy-mm-dd\')\norder by w.id, soh.createdtime\n\n',3,1,'connectionpool-1'),(181,'2013-07-19 00:00:00',NULL,NULL,8,'2013-12-01 10:52:53',NULL,NULL,'000050000100002',0,0,3,'空库位统计','仓库:Number\n\n\n',9,NULL,'select l.locationcode 库位号, c.cncodename 库位类型\n from  gv_bas_location l, gv_sys_codeinfo c\n where l.locationusage_id = c.id\n and ( not exists (select x.id from gv_inv_lotlocationuom x where x.location_id = l.id and x.qtyUom > 0) )\n and l.warehouse_id = ?',2,1,'connectionpool-1'),(182,'2013-07-19 13:09:04',NULL,NULL,21,'2013-12-01 10:52:41',NULL,NULL,'000050000400002',0,0,3,'双十一统计',NULL,10,NULL,NULL,2,0,NULL),(183,'2013-07-19 00:00:00',NULL,NULL,30,'2013-12-02 14:52:18',NULL,NULL,'00005000040000200001',0,0,4,'下单验货发货等统计（按天）','起始时间:date:false,结束时间:date:false',182,NULL,'select 仓库, 日期, 预分配单数, 验货单数, 验货件数, 发货单数 from (\n  select w.descr 仓库, trunc(l.createdtime) 日期,   \n       sum(case when l.operatetype_id = 2427 then 1 else 0 end) as 预分配单数,  \n       count(distinct case when l.operatetype_id = 2600 then l.docno end) as 验货单数,  \n       sum(case when l.operatetype_id = 2600 then 1 else 0 end) as 验货件数,  \n       sum(case when l.operatetype_id = 548 then 1 else 0 end) as 发货单数  \n  from gv_log_document_log l, gv_bas_warehouse w  \n  where l.warehouse_id = w.id  \n       and w.whclass_id = 109104  \n       and l.createdtime >= ?  \n       and l.createdtime <  ?  \n  group by trunc(l.createdtime), w.descr   \n) order by 日期, 发货单数 desc\n',1,1,'connectionpool-1'),(184,'2013-07-19 00:00:00',NULL,NULL,7,'2013-12-01 10:53:35',NULL,NULL,'000050000100003',0,0,3,'库存日志',NULL,9,NULL,'select wh as 仓库, docNo as 单据号, opType as 操作类型, skucode, t.locationcode as 库位,  \n       case when qtyUom   = \'0 --> 0\' then null else  qtyUom end as 库存量, \n       case when qty  = \'0 --> 0\' then null else  qty end as 库存EA量, \n       case when avaliableUom  = \'0 --> 0\' then null else  avaliableUom end as 可用量, \n       case when onholdUom  = \'0 --> 0\' then null else  onholdUom end as 冻结量, \n       case when allocatedUom = \'0 --> 0\' then null else  allocatedUom end as 分配量,\n       case when pickedUom = \'0 --> 0\' then null else  pickedUom end as picked量,\n       createdTime, t.llu_id\n       from (\nselect wh.descr as wh, sku.skucode, ot.cncodename as opType, d.docNo, t.llu_id, l.locationcode,      \n       t.qtyUom || \' --> \' || t.toQtyUom as qtyUom, t.qtyeach || \' --> \' || t.toqtyeach as qty, \n       t.qtyUseUom || \' --> \' || t.toQtyUseUom as avaliableUom, \n       t.qtyonholdUom || \' --> \' || t.toQtyonholdUom as onholdUom, \n       t.qtyallocatedUom || \' --> \' || t.toQtyallocatedUom as allocatedUom, \n       t.qtypickedUom || \' --> \' || t.toQtypickedUom as pickedUom, \n       to_char(t.createdTime, \'yyyy-mm-dd hh24:mi:ss\') createdTime\nfrom gv_log_transaction_log t, gv_log_document_log d, gv_sys_codeinfo dt, gv_sys_codeinfo ot, \n     gv_inv_lotlocationuom llu, gv_bas_sku sku, gv_bas_warehouse wh, gv_bas_location l \nwhere t.doclog_id = d.id and d.doctype_id = dt.id and d.operatetype_id = ot.id\n      and t.llu_id = llu.id and llu.sku_id = sku.id and llu.warehouse_id = wh.id and llu.location_id = l.id\n      and t.createdtime >= to_date(\'2013-11-08\', \'yyyy-mm-dd\')\n      and t.createdtime < to_date(\'2013-11-09\', \'yyyy-mm-dd\')\n      and llu.sku_id=3447846 \n      --and llu.warehouse_id = 100701\n      --and t.llu_id in (17977676)\n) t\norder by t.createdtime',3,1,'connectionpool-1'),(185,'2013-07-19 00:00:00',NULL,NULL,13,'2013-12-01 20:13:38',NULL,NULL,'000050000200006',0,0,3,'看板(仓库当天作业量)','仓库:Number,customizeReport\n\n\n\n\n',12,'用到了HTML5的图形功能，如果你当前浏览器不支持HTML5，请复制弹出页面的网址在Chrome里浏览\n','url:wms/kanban.html,../wms/kanban/2/\n\n\n\n\n\n',6,1,'connectionpool-1'),(186,'2013-10-08 00:00:00',NULL,NULL,3,'2013-12-01 10:51:20',NULL,NULL,'00006',0,0,1,'快运报表',NULL,0,NULL,NULL,6,0,'connectionpool-2'),(187,'2013-10-08 00:00:00',NULL,NULL,4,'2013-12-02 15:31:25',NULL,NULL,'0000600001',0,0,2,'装载率统计','起点:String:false,终点:String:false,从时间:date:false,到时间:date:false',186,NULL,'select  日期, 线路, 实重, 额重, 装载率 from (\n select DATE_FORMAT(t.f1, \'%Y%m\') 日期, max(f4) 线路, sum(t.f5) 实重, sum(t.f6) 额重, avg(t.f7) 装载率 \n from btr_zzl t \n where f2 = ? and f3 = ? and t.f1 >= ? and t.f1 <= ?\n group by 日期 \n) x',1,1,'connpool-btr-mysql'),(188,'2013-11-24 00:00:00',NULL,NULL,5,'2013-11-24 17:39:20',NULL,NULL,'0000600002',1,0,2,'装载率统计',NULL,186,NULL,'select * from component_param t ',2,1,'connectionpool'),(189,'2013-11-25 00:00:00',NULL,NULL,4,'2013-11-25 21:15:35',NULL,NULL,'0000600004',0,0,2,'路线节点列表',NULL,186,NULL,'select distinct city, province from btr_city t order by province, city',4,1,'connpool-btr-mysql'),(190,'2013-11-25 00:00:00',NULL,NULL,3,'2013-12-01 10:51:35',NULL,NULL,'00005',0,0,1,'仓储报表',NULL,0,NULL,NULL,5,0,'connectionpool-2'),(191,'2013-12-01 10:55:20',NULL,NULL,3,NULL,NULL,NULL,'0000600006',0,0,2,'装载率统计（图表）','customizeReport',186,NULL,'url:btr/zzl.html',6,1,'connpool-btr-mysql'),(192,'2013-12-01 00:00:00',NULL,NULL,10,'2013-12-06 16:00:20',NULL,NULL,'000060002400001',0,0,3,'全网货量',NULL,210,NULL,'select sum(WEIGHT) 全网总货量, trunc(t.send_date-1/2) as 日期\n  from usrvf_gg.gt_bill t\n where t.SEND_DATE >= to_date(\'2013-01-01 12:00:00\', \'yyyy-mm-dd  hh24:mi:ss\')\n   and t.SEND_DATE <= to_date(\'2013-11-19 11:59:59\', \'yyyy-mm-dd  hh24:mi:ss\')\n group by trunc(t.send_date-1/2)\n',1,1,'connpool-vf-oracle'),(193,'2013-12-01 00:00:00',NULL,NULL,17,'2013-12-06 16:00:33',NULL,NULL,'000060002400002',0,0,3,'各省日货量','时间一:date:false,时间二:date:false',210,NULL,'select sum(重量) as 重量, 省份\n  from (select round(sum(WEIGHT) / 1000) 重量,\n               case\n                 when (s.org_name = \'北京分公司\' or s.org_name = \'天津分公司\' or\n                      s.org_name = \'河北分公司\') then\n                  \'华北\'\n                 when s.org_name = \'福建分公司\' then\n                  \'浙江\'\n                 else\n                  replace(s.org_name, \'分公司\', \'\')\n               end 省份\n          from usrvf_gg.gt_trans_order t, usrvf_gg.gt_site s\n         where t.send_site_id = s.id\n           and t.send_date >= ? + 1 / 2\n           and t.send_date <= ? + 3 / 2\n         group by s.org_name)\n group by 省份\n',2,1,'connpool-vf-oracle'),(194,'2013-12-01 00:00:00',NULL,NULL,10,'2013-12-11 16:58:58',NULL,NULL,'000060002400007',0,0,3,'各省日物料收入','时间:date:false,时间:date:false',210,NULL,' select sum(收入) as 收入,省份 from (select sum(money) as 收入,  case\n         when (s.org_name = \'北京分公司\' or s.org_name = \'天津分公司\' or\n              s.org_name = \'河北分公司\') then\n          \'华北\'\n          when s.org_name = \'福建分公司\' then \'浙江\'\n         else\n          replace(s.org_name, \'分公司\', \'\')\n       end 省份   ,trunc(register_date) as 日期\n  from GT_STOCK_APPLY t,usrvf_gg.gt_site s\n where t.register_date >= ? \n   and t.register_date <=? + 1\n   and s.id=t.apply_site_id\n group by trunc(register_date),s.org_name)\n group by 省份\n order by 省份\n \n',7,1,'connpool-vf-oracle'),(195,'2013-12-01 00:00:00',NULL,NULL,8,'2013-12-06 16:06:44',NULL,NULL,'000060002400006',0,0,3,'各省中转费收入',NULL,210,NULL,'select sum(money) as 金额, 省份\n  from (select distinct b.code,\n                        t.price_type 费用类型,\n                        case\n                          when t.price_type = \'派件费\' then\n                           -1 * to_number(t.money)\n                          else\n                           to_number(t.money)\n                        end money,\n                        case\n                          when (s.range_id=60002) then\n                           \'华北\'\n                          when s.org_name = \'福建分公司\' then\n                           \'浙江\'\n                          else\n                           replace(s.org_name, \'分公司\', \'\')\n                        end 省份,\n                         a.operate_site_name 计费中心,\n                        a.site_name 上一站,\n                        a.operate_site_name 操作站,\n                        a.pay_company 付款方,\n                        a.charge_company 收款方,\n                        t.created_time as 日期\n        \n          from usrvf_gg.gt_bill_detail t,\n               usrvf_gg.gt_charging    a,\n               usrvf_gg.gt_bill        b,\n               usrvf_gg.gt_site        s\n         where t.charging_id = a.id\n           and a.bill_id = b.id\n           and b.send_site_id = s.id\n           and t.created_time >=\n               to_date(\'2013-11-18 12:00:00\', \'yyyy-mm-dd  hh24:mi:ss\')\n           and t.created_time <=\n               to_date(\'2013-11-19 11:59:59\', \'yyyy-mm-dd  hh24:mi:ss\'))\n group by 省份\n',6,1,'connpool-vf-oracle'),(196,'2013-12-01 00:00:00',NULL,NULL,16,'2013-12-06 16:05:21',NULL,NULL,'000060002400005',0,0,3,'各省日中转与物料收入','时间一:date:false,时间二:date:false,时间一:date:false,时间二:date:false',210,NULL,'select zhongzhuan.中转收入 as incomeTrans,zhongzhuan.省份 as province, wuliao.物料收入 as incomeStock\n  from (select sum(money) as 中转收入, 省份, trunc(日期 - 1 / 2) as 日期\n          from (select distinct b.code,\n                                t.price_type 费用类型,\n                                case\n                                  when t.price_type = \'派件费\' then\n                                   -1 * to_number(t.money)\n                                  else\n                                   to_number(t.money)\n                                end money,\n                                case\n                                  when (s.range_id = 60002) then\n                                   \'华北\'\n                                  when s.org_name = \'福建分公司\' then\n                                   \'浙江\'\n                                  else\n                                   replace(s.org_name, \'分公司\', \'\')\n                                end 省份,\n                                a.operate_site_name 计费中心,\n                                a.site_name 上一站,\n                                a.operate_site_name 操作站,\n                                a.pay_company 付款方,\n                                a.charge_company 收款方,\n                                t.created_time as 日期\n                \n                  from usrvf_gg.gt_bill_detail t,\n                       usrvf_gg.gt_charging    a,\n                       usrvf_gg.gt_bill        b,\n                       usrvf_gg.gt_site        s\n                 where t.charging_id = a.id\n                   and a.bill_id = b.id\n                   and b.send_site_id = s.id\n                   and t.created_time >= ? + 1 / 2\n                   and t.created_time <=? + 3 / 2)\n         group by trunc(日期 - 1 / 2), 省份) zhongzhuan,\n       (select sum(收入) as 物料收入, 省份\n          from (select sum(money) as 收入,\n                       case\n                         when (s.org_name = \'北京分公司\' or s.org_name = \'天津分公司\' or\n                              s.org_name = \'河北分公司\') then\n                          \'华北\'\n                         when s.org_name = \'福建分公司\' then\n                          \'浙江\'\n                         else\n                          replace(s.org_name, \'分公司\', \'\')\n                       end 省份,\n                       trunc(register_date) as 日期\n                  from GT_STOCK_APPLY t, usrvf_gg.gt_site s\n                 where t.register_date >= ? \n                   and t.register_date <= ?\n                   and s.id = t.apply_site_id\n                 group by trunc(register_date), s.org_name)\n         group by 省份) wuliao\n where \n   zhongzhuan.省份 = wuliao.省份(+)\norder by province\n',5,1,'connpool-vf-oracle'),(197,'2013-12-02 00:00:00',NULL,NULL,23,'2013-12-17 16:42:59',NULL,NULL,'000060002500001',0,0,3,'货量走势按日','从时间:date:false,到时间:date:false',211,NULL,'select floor(sum(WEIGHT/1000)) as 重量, trunc(SEND_DATE-1/2) as 日期\n  from usrvf_gg.gt_bill t\n where SEND_DATE >= ? + 1/2\n   and SEND_DATE <= ? + 3/2\n group by  trunc(SEND_DATE-1/2)\n order by 日期\n\n\n',1,1,'connpool-vf-oracle'),(198,'2013-12-02 17:17:52',NULL,NULL,4,NULL,NULL,NULL,'0000600011',0,0,2,'日货量方向',NULL,186,NULL,'select sum(weight) as 重量, 出发省份, 目的省份\n  from (select sum(WEIGHT) as weight,\n               case\n                 when (s.range_id = 60002) then\n                  \'华北\'\n                 when s.org_name = \'福建分公司\' then\n                  \'浙江\'\n                 else\n                  replace(s.org_name, \'分公司\', \'\')\n               end 出发省份,\n               case\n                 when (ss.range_id = 60002) then\n                  \'华北\'\n                 when ss.org_name = \'福建分公司\' then\n                  \'浙江\'\n                 else\n                  replace(ss.org_name, \'分公司\', \'\')\n               end 目的省份\n          from usrvf_gg.gt_bill t, usrvf_gg.gt_site s, usrvf_gg.gt_site ss\n         where t.SEND_DATE >=\n               to_date(\'2013-11-18 12:00:00\', \'yyyy-mm-dd  hh24:mi:ss\')\n           and t.SEND_DATE <=\n               to_date(\'2013-11-19 11:59:59\', \'yyyy-mm-dd  hh24:mi:ss\')\n           and t.send_site_id = s.id\n           and t.disp_site_id = ss.id\n         group by trunc(t.send_date - 1 / 2), s.org_name,ss.org_name,s.range_id,ss.range_id)\n group by 出发省份, 目的省份\n order by 出发省份,目的省份\n',11,1,'connpool-vf-oracle'),(199,'2013-12-03 00:00:00',NULL,NULL,24,'2013-12-13 16:53:26',NULL,NULL,'000060002400003',0,0,3,'分拨日出货量','时间:date:false,时间:date:false',210,NULL,'select round(sum(w)) as 重量, 分拨\n  from (select sum(weight) as w,\n               case\n                 when t.center_in_name = \'苏州\' then\n                  \'无锡\'\n                 when t.center_in_name = \'昆山\' then\n                  \'无锡\'\n                 when t.center_in_name = \'仙居\' then\n                  \'台州\'\n                 when t.center_in_name = \'顺德\' then\n                  \'广州\'\n                 when t.center_in_name = \'扬州\' then\n                  \'南京\'\n                 when t.center_in_name = \'上海闵行一部\' then\n                  \'上海\'\n                 when t.center_in_name = \'佛山\' then\n                  \'广州\'\n                 when t.center_in_name = \'莞城\' then\n                  \'新塘\'\n                 when t.center_in_name = \'玉环\' then\n                  \'台州\'\n                 when t.center_in_name = \'乐清一部\' then\n                  \'台州\'\n                 when t.center_in_name = \'河源\' then\n                  \'虎门\'\n                 when t.center_in_name = \'河北廊坊\' then\n                  \'北京\'\n                 when t.center_in_name = \'肇庆\' then\n                  \'广州\'\n                 when t.center_in_name = \'河北张家口\' then\n                  \'北京\'\n                 else\n                  replace(t.center_in_name,\'分拨\',\'\') \n               end 分拨\n          from usrvf_gg.gt_bill t, usrvf_gg.gt_site s\n         where t.created_time -1/2 >= ?\n           and t.created_time -3/2 <= ?\n           and t.send_site_id = s.id\n         group by t.center_in_name)\n group by 分拨\n order by 重量 desc\n',3,1,'connpool-vf-oracle'),(200,'2013-12-03 00:00:00',NULL,NULL,18,'2013-12-22 10:33:44',NULL,NULL,'000060002400015',0,0,3,'分拨留仓次数种类','时间:date:false,时间:date:false',210,NULL,'select sum(subq) as 子单数, typet as 留次类\n  from (select case when leaveCenterTime > = 4 then \'四次及以上留仓\' when leaveCenterTime = 3 then \'三次留仓\' when leaveCenterTime = 2 then \'二次留仓\' when leaveCenterTime = 1 then \'一次留仓\' end typet,\n               subq\n          from (select leaveCenterTime, count(scan_site_name) as subq\n                  from (select scan_site_name, leaveCenterTime\n                          from (select count(day) as leaveCenterTime,\n                                       k.scan_site_name,\n                                       scan_code\n                                  from (select distinct scan_code,\n                                                        scan_site_name,\n                                                        scan_type_name,\n                                                        trunc(scan_date) as day\n                                          from usrvf_gg.gt_scan\n                                         where scan_type_name = \'留仓\'\n                                           and scan_date >=? + 1/2\n                                           and scan_date <? + 3/2) k\n                                 group by k.scan_site_name, scan_code))\n                 group by leaveCenterTime))\n group by typet\n order by 子单数\n\n',15,1,'connpool-vf-oracle'),(201,'2013-12-03 00:00:00',NULL,NULL,17,'2013-12-22 10:32:59',NULL,NULL,'000060002400011',0,0,3,'一次留仓单数','时间:date:false,时间:date:false',210,NULL,'select count(center) as 子单数,\n       center as 分拨\n  from (select center, leaveCenterTime\n          from (select count(day) as leaveCenterTime,\n                       replace(k.scan_site_name,\'分拨\',\'\') as center,\n                       scan_code\n                  from (select distinct scan_code,\n                                        scan_site_name,\n                                        scan_type_name,\n                                        trunc(scan_date) as day\n                          from usrvf_gg.gt_scan\n                         where scan_type_name = \'留仓\'\n                           and scan_date >= ? + 1/2\n                           and scan_date <= ? + 3/2 ) k\n                 group by k.scan_site_name, scan_code)\n         where leaveCenterTime = 1)\n group by center\n order by 子单数\n',11,1,'connpool-vf-oracle'),(202,'2013-12-03 00:00:00',NULL,NULL,13,'2013-12-22 10:33:08',NULL,NULL,'000060002400012',0,0,3,'二次留仓单数','时间:date:false,时间:date:false',210,NULL,'select count(center) as 子单数,\n       center as 分拨\n  from (select center, leaveCenterTime\n          from (select count(day) as leaveCenterTime,\n                       replace(k.scan_site_name,\'分拨\',\'\') as center,\n                       scan_code\n                  from (select distinct scan_code,\n                                        scan_site_name,\n                                        scan_type_name,\n                                        trunc(scan_date) as day\n                          from usrvf_gg.gt_scan\n                         where scan_type_name = \'留仓\'\n                           and scan_date >= ? + 1/2\n                           and scan_date <= ? + 3/2  ) k\n                 group by k.scan_site_name, scan_code)\n         where leaveCenterTime = 2)\n group by center\n order by 子单数',12,1,'connpool-vf-oracle'),(203,'2013-12-03 00:00:00',NULL,NULL,12,'2013-12-22 10:33:16',NULL,NULL,'000060002400013',0,0,3,'三次留仓单数','时间:date:false,时间:date:false',210,NULL,'select count(center) as 子单数,\n       center as 分拨\n  from (select center, leaveCenterTime\n          from (select count(day) as leaveCenterTime,\n                       replace(k.scan_site_name,\'分拨\',\'\') as center,\n                       scan_code\n                  from (select distinct scan_code,\n                                        scan_site_name,\n                                        scan_type_name,\n                                        trunc(scan_date) as day\n                          from usrvf_gg.gt_scan\n                         where scan_type_name = \'留仓\'\n                           and scan_date >= ? + 1/2\n                           and scan_date <= ? + 3/2 ) k\n                 group by k.scan_site_name, scan_code)\n         where leaveCenterTime = 3)\n group by center\n order by 子单数',13,1,'connpool-vf-oracle'),(204,'2013-12-03 00:00:00',NULL,NULL,14,'2013-12-22 10:33:23',NULL,NULL,'000060002400014',0,0,3,'大于等于四次留仓单数','时间:date:false,时间:date:false',210,NULL,'select count(center) as 子单数,\n       center as 分拨\n  from (select center, leaveCenterTime\n          from (select count(day) as leaveCenterTime,\n                       replace(k.scan_site_name,\'分拨\',\'\') as center,\n                       scan_code\n                  from (select distinct scan_code,\n                                        scan_site_name,\n                                        scan_type_name,\n                                        trunc(scan_date) as day\n                          from usrvf_gg.gt_scan\n                         where scan_type_name = \'留仓\'\n                           and scan_date >= ? + 1/2\n                           and scan_date <= ? + 3/2 ) k\n                 group by k.scan_site_name, scan_code)\n         where leaveCenterTime >= 4)\n group by center\n order by 子单数',14,1,'connpool-vf-oracle'),(205,'2013-12-04 00:00:00',NULL,NULL,44,'2013-12-17 15:59:40',NULL,NULL,'000060002500005',0,0,3,'问题件破损少件走势按日','从时间:date:false,到时间:date:false',211,NULL,'select sum(mainp) / count(mainp) as 百分比, day as 日期\n  from (select case\n                 when (t.problem_type_name = \'破损\' or t.problem_type_name = \'少件\') then\n                  1\n                 else\n                  0\n               end mainp,\n               trunc(created_time - 1 / 2) as day\n          from usrvf_gg.gt_problem t \n         where t.created_time > ?               \n           and t.created_time <= ? + 1)\n group by day\n order by day',5,1,'connpool-vf-oracle'),(206,'2013-12-04 00:00:00',NULL,NULL,29,'2013-12-11 17:25:21',NULL,NULL,'000060002400004',0,0,3,'各分拨日操作货量','时间一:date:false,时间二:date:false',210,NULL,'select scan_site_name as 分拨,\n       round(sum(weight) * 2/1000) as 货量,\n       count(scan_code)*2 as 票数\n  from (select distinct t.scan_code,\n                        replace(t.scan_site_name,\'分拨\',\'\')  as   scan_site_name,                \n                        b.weight\n          from usrvf_gg.gt_scan t, usrvf_gg.gt_bill b\n         where t.record_site_name like \'%分拨%\'\n           and t.scan_date >= ? + 1/2\n           and t.scan_date <= ? + 3/2                   \n           and (length(t.scan_code) = 11 or length(t.scan_code) = 12)\n           and t.scan_code = b.code)\n group by scan_site_name \n order by 货量 DESC',4,1,'connpool-vf-oracle'),(207,'2013-12-04 00:00:00',NULL,NULL,15,'2013-12-24 12:15:54',NULL,NULL,'000060002500004',0,0,3,'分拨出入货量走势按日','从时间:date:false,到时间:date:false,从时间:date:false,到时间:date:false,分拨:string:false',211,NULL,'select inCenter.日期  as 日期,\n       inCenter.重量  as 入网重量,\n       outCenter.重量 as 出网重量\n  from (select round(sum(w)/1000) as 重量, 分拨,日期\n          from (select sum(weight) as w,\n                       case\n                         when i = \'苏州\' then\n                          \'无锡\'\n                         when i = \'昆山\' then\n                          \'无锡\'\n                         when i = \'仙居\' then\n                          \'台州\'\n                         when i = \'顺德\' then\n                          \'广州\'\n                         when i = \'扬州\' then\n                          \'南京\'\n                         when i = \'上海闵行一部\' then\n                          \'上海\'\n                         when i = \'佛山\' then\n                          \'广州\'\n                         when i = \'莞城\' then\n                          \'新塘\'\n                         when i = \'玉环\' then\n                          \'台州\'\n                         when i = \'乐清一部\' then\n                          \'台州\'\n                         when i = \'河源\' then\n                          \'虎门\'\n                         when i = \'河北廊坊\' then\n                          \'北京\'\n                         when i = \'肇庆\' then\n                          \'广州\'\n                         when i = \'河北张家口\' then\n                          \'北京\'\n                          when i = \'杭州滨江\' then\n                          \'杭州\'\n                          when i = \'常州一部\' then\n                          \'无锡\'\n                          when i = \'昆明\' then\n                          \'昆明\'\n                         else\n                          replace(i, \'分拨\', \'\')\n                       end 分拨,\n                       日期\n                       from\n                      ( select weight,trunc(t.created_time - 1 / 2) as 日期,t.center_in_name as i\n                  from usrvf_gg.gt_bill t, usrvf_gg.gt_site s\n                 where t.created_time >= ? + 1 / 2\n                   and t.created_time <= ? + 3 / 2\n                   and t.send_site_id = s.id)\n                 group by i, 日期)\n         group by 日期,分拨) inCenter,\n       (select round(sum(w)/1000) as 重量, 分拨,日期\n          from (select sum(weight) as w,\n                       case\n                         when o = \'苏州\' then\n                          \'无锡\'\n                         when o= \'昆山\' then\n                          \'无锡\'\n                         when o= \'仙居\' then\n                          \'台州\'\n                         when o = \'顺德\' then\n                          \'广州\'\n                         when o = \'扬州\' then\n                          \'南京\'\n                         when o= \'上海闵行一部\' then\n                          \'上海\'\n                         when o = \'佛山\' then\n                          \'广州\'\n                         when o = \'莞城\' then\n                          \'新塘\'\n                         when o = \'玉环\' then\n                          \'台州\'\n                         when o = \'乐清一部\' then\n                          \'台州\'\n                         when o = \'河源\' then\n                          \'虎门\'\n                         when o = \'河北廊坊\' then\n                          \'北京\'\n                         when o = \'肇庆\' then\n                          \'广州\'\n                         when o = \'杭州滨江\' then\n                          \'杭州\'\n                          when o = \'常州一部\' then\n                          \'无锡\'\n                          when o = \'昆明\' then\n                          \'昆明\'\n                         else\n                          replace(o, \'分拨\', \'\')\n                       end 分拨,日期 from\n                       (select weight, trunc(t.creat