_Range_GetWeekFirstAndEndDays](@tmpDateSTART DATETIME,@tmpDateEND DATETIME) \nRETURNS  @tmpTable TABLE(WeekOrder INT,FirstDay DATETIME , EndDay DATETIME) \nAS \nBEGIN    \n DECLARE   @tmpDate   DATETIME \n DECLARE   @index         INT \n SET       @tmpDate=@tmpDateSTART \n SET       @index=1 \n     WHILE     @tmpDate <=@tmpDateEND \n        BEGIN  \n             INSERT INTO @tmpTable \n                SELECT @index,a.FirstDay,b.EndDay FROM (     \n                    SELECT 1 AS ID,DATEADD(wk, DATEDIFF(wk,0,@tmpDate), 0) AS FirstDAy) a \n                LEFT JOIN ( \n                    SELECT 1 AS ID,DATEADD(wk, DATEDIFF(wk,0,@tmpDate), 6) AS EndDay) b \n                ON a.ID = b.ID \n \n          SET   @tmpDate=DATEADD(DAY,7,@tmpDate) \n          SET   @index=@index+1 \n         END  \n     RETURN \nEND\nselect inTime/allTransO as 达成率,* as 日期\nfrom timeE,My_Range_GetWeekFirstAndEndDays(?,?)\n\n',14,1,'connpool-btr-mysql'),(224,'2013-12-17 00:00:00',NULL,NULL,4,'2013-12-17 16:04:39',NULL,NULL,'000060002500015',1,0,3,'全网时效达成走势按月','从时间:date:false,到时间:date:false',211,NULL,NULL,15,1,'connpool-btr-mysql'),(225,'2013-12-18 00:00:00',NULL,NULL,9,'2013-12-23 15:57:31',NULL,NULL,'000060002500016',0,0,3,'装载率按日','从时间:date:false,到时间:date:false,线路:String:false',211,NULL,'select inDay,weight,loadW,loadRate\nfrom loadR\nwhere inDay >= ?\nand inDay <= ?\nand routine = ?',16,1,'connpool-btr-mysql'),(226,'2013-12-19 00:00:00',NULL,NULL,5,'2013-12-24 10:06:15',NULL,NULL,'000060002500017',0,0,3,'省份分拨货量走势按日','从时间:date:false,到时间:date:false,分公司:String:false',211,NULL,'select inCenter.日期  as 日期,\n       inCenter.分拨 as 分拨,\n       inCenter.重量  as 入网重量\n  from (select round(sum(w)/1000) as 重量, 分拨,日期\n          from (select sum(weight) as w,\n                       case\n                         when t.center_in_name = \'苏州\' then\n                          \'无锡\'\n                         when t.center_in_name = \'昆山\' then\n                          \'无锡\'\n                         when 